import React from "react";

function Footer() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-3">
          <img src="media/images/logo.svg" style={{ width: "80%" }}></img>
        </div>
        <div className="col">
          <h3>Account</h3>
          <ul>
            <li>Open demat account</li>
          </ul>
        </div>
        <div className="col"></div>
        <div className="col"></div>
      </div>
    </div>
  );
}

export default Footer;
